    false,nt"url": null,nt"notes": "Polygons representing hydrographic features
    (lakes, ponds, some rivers, and open water areas) originating from the USGS 1:100,000
    (100K)DLG (Digital Line Graph) dataset. (USCLASS's 116,400,402,412,421; see attributes).
    The data have been converted into ArcView and the attribute tables restructured
    and enhanced to better support DNR business practices. During 2003 and 2004, DNR
    Division of Waters Lake Numbers were added and many lake outlines have been redigitized
    at 1:5,000 or better to support DNR Fisheries applications.",nt"license_title":
